import Head from "next/head";

const Home = () => {
  return (
    <div>
      <Head>
        <title>Beto Muniz</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <main>
        <h1>
          Welcome to <a href="https://nextjs.org">Next.js!</a>
        </h1>
      </main>
    </div>
  );
};

export default Home;
